import * as React from 'react';
import Box from '@mui/material/Box';
// import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { Modal, Button } from '@mui/material';
import { Link } from 'react-router-dom';

const style = {
  position: 'absolute',
  top: '50%',
  left: '50%',
  transform: 'translate(-50%, -50%)',
  width: 200,
  bgcolor: 'background.paper',
  border: '2px solid #000',
  boxShadow: 24,
  p: 4,
};
// delete presentation
function DeletePresentation ({ open, setOpen, deleteCard, id }) {
  const handleClose = () => setOpen(false);
  const handleDelete = () => {
    deleteCard('/' + id);
    setOpen(false);
    console.log('delete sucess');
  };

  return (
    <>
      <Modal
        open={open}
        onClose={handleClose}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <Box sx={style}>
            <Typography id="modal-modal-title" variant="h6" component="h2" style={{ marginBottom: '2vh' }}>
            Are you sure?
            </Typography>
            <Link to='/'><Button variant="text" onClick={handleDelete}>YES</Button></Link>
            <Button variant="text" onClick={handleClose}>NO</Button>
        </Box>
      </Modal>
    </>
  );
}
export default DeletePresentation;
